		    2: `<b> Step 1</b> <br> <br> The animation serves to visualize the principles of working with one of the fundamental abstract data types – the doubly linked list. This is used as a simple dynamic data structure for storing information.<br>  
		        <b>Description of individual window sections:</b><br>  
		        &nbsp;&nbsp;<b>1. Code - </b>This section displays the entire code of the visualized problem in the C programming language. It is located in the lower-left window.<br>  
		        &nbsp;&nbsp;<b>2. Visualization - </b>This window is used to visualize ongoing processes, making it easier to understand the given problem with a certain level of abstraction. It is located in the dominant upper window.<br>  
		        &nbsp;&nbsp;<b>3. Explanatory text</b>`,
			3: `<b> Step 2</b> <br> <br>  When the program starts, the <b>main()</b> function initializes two pointers, <i>head</i> and <i>tail</i>, which will be used to manage the doubly linked list. These pointers are responsible for keeping track of the first and last elements of the list. At this point, however, the list is empty, so both pointers are set to <b>NULL</b>.
				This initialization is crucial because it establishes a clear starting point for the linked list. When head and tail are NULL, it means that no elements exist in the list yet. As new elements are added, these pointers will be updated accordingly to reflect the structure of the list.`,
			4: `<b> Step 3</b> <br> <br> Inside <b>insertBack</b>, we firstly enter the function <b>createNode</b> to allocate memory for a <i>new node</i> and initialize it with the given data. At the same time, the pointers <i>h</i> and <i>t</i>, which are passed as references to the insertBack function, point to head and tail, respectively.`,
			5: `<b> Step 4</b> <br> <br> Now that we entered <b>createNode</b> function, we allocated memory for a new node named <i>newNode</i>. This node contains: <i> pointers that hold memory adresses</i> named <b>prev</b> and <b>next</b> as well as a member used to store a value, named <b>data</b>. In condition <i>if (newNode ==NULL), we check whether the <i>malloc</i> function succeeded allocating the memory. If not, we would receive an error message in	a console.`,
			6: `<b> Step 5</b> <br> <br> Predefined value named <i> data </i>, which is integer, gets passed to the data field of the newly created node .`,
			7: `<b> Step 6</b> <br> <br><i>newNode->next</i> refers to the next pointer of the newly created node. By setting it to NULL, we are indicating that, at the moment, this node does not have any node after it. It is the end of the list.`,
			8: `<b> Step 7</b> <br> <br><i>newNode->prev</i> refers to the prev pointer of the newly created node. By setting it to NULL, we are indicating that, at the moment, this node does not have any node before it. Then, we return back to the <b>insertBack</b> function.`,
